    "nunivak-island-national-wildlife-refuge-annual-narrative-report-calendar-year-1979",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Nunivak
    Island National Wildlife Refuge outlines Refuge accomplishments during the 1979
    calendar year. The report begins by giving a brief introduction to the district,
    as well as the climatic and habitat conditions, land acquisition program, and system
    status during the year. The construction and maintenance section discusses construction,
    maintenance, and wildfire. Habitat management is discussed; topics include wilderness
    and special areas. Wildlife- including threatened and endangered species, migratory
    birds, and mammals- is also covered. The interpretation and recreation section discusses
    information and interpretation, recreation, and enforcement. Field investigations,
    cooperative programs, items of interest, and safety are discussed. Photographs are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
